import './App.css';
import Header from './Header';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TinderCards from './TinderCards';

function App() {
  console.log("Test");
  return (
    <div className="App">
      <Header />
      <Router>
        <Routes>
          <Route path="/chat" element={<h1>I'm the chat page</h1>} />
          <Route path="/" element={
            <TinderCards />
          } />
        </Routes>
      </Router >
    </div >
  );
}

export default App;
